function renameFolder(e,t){const n=document.querySelector("#rename-folder-box-"+t+' input[type="text"]').value;fetch(`/ajax/renamefolder.php?user_id=${e}&folder_id=${t}&new_name=${n}`,{method:"get"}).then(e=>{if(e.status>=200&&e.status<300)return e.text()}).then(e=>{window.displayStatus(e),document.querySelector("#rename-folder-"+t).style.display="none",document.querySelector("#file-"+t+" p").innerHTML=n})}function deleteAudioFile(e,t){fetch(`/ajax/deleteaudio.php?user_id=${e}&audio_id=${t}`,{method:"get"}).then(e=>{if(e.status>=200&&e.status<300)return e.text()}).then(e=>{document.querySelector(".delete-container").style.display="none",window.displayStatus(e)})}function shareAudioFile(e,t,n){fetch(`/ajax/shareaudio.php?user_id=${e}&audio_id=${t}`,{method:"get"}).then(e=>{if(e.status>=200&&e.status<300)return e.text()}).then(e=>{document.querySelector(".share-container").style.display="none",window.displayStatus(e)})}function renameAudioFile(e,t){console.log(t);const n=document.querySelector("#"+t+' input[type="text"]').value;console.log(n);const o=t.substring(16);console.log(o),fetch(`/ajax/renameaudio.php?user_id=${e}&audio_id=${o}&new_name=${n}`,{method:"get"}).then(e=>{if(e.status>=200&&e.status<300)return e.text()}).then(e=>{window.displayStatus(e),console.log(o),document.querySelector("#rename-audio-box-"+o).style.display="none",document.querySelector("#file-"+o+" p").innerHTML=n})}
